import React, { Component }  from 'react';

class ListItem extends Component
{
  render()
  {
    return (
      <div style={{
        display: 'flex'
      }}>
        <img src={this.props.poster} width='120vh' height='171vh' />
        <div>
          <div>Movie Title</div>
          <div style={{
            display: 'flex',
            justifyContent: 'space-between'
          }}>
            <img src='netflix.png' width='32px' height='32px' />
            <img src='icons/hbo.png' width='32px' height='32px' />
            <img src='icons/hulu.png' width='32px' height='32px' />
            <img src='icons/amazon.png' width='32px' height='32px' />
          </div>
        </div>
      </div>
    );
  }
}

export default ListItem;
